import React, { useEffect, useState } from "react";
import axios from "axios";
import TopBar from "../components/TopBar";
import moment from "moment";

function TablingLogs() {
  const [logs, setLogs] = useState([]);
  const [filteredLogs, setFilteredLogs] = useState([]);
  const [orgOptions, setOrgOptions] = useState([]);

  const [search, setSearch] = useState("");
  const [orgFilter, setOrgFilter] = useState("");
  const [noShowFilter, setNoShowFilter] = useState("");
  const [actionFilter, setActionFilter] = useState("");
  const [dateFilter, setDateFilter] = useState(moment().format("YYYY-MM-DD"));

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await axios.get("/api/organizations/all-logs");
        const flattened = res.data.flatMap((org) =>
          org.reservations.map((r) => ({ ...r, organization: org.name }))
        );
        setLogs(flattened);
        setOrgOptions([...new Set(res.data.map((o) => o.name))]);
      } catch (err) {
        console.error("Failed to fetch logs:", err);
      }
    };
    fetchData();
  }, []);

  useEffect(() => {
    const filtered = logs.filter((log) => {
      const dateMatch = moment(log.timestamp || log.checkInTime || log.rangeStart)
        .format("YYYY-MM-DD") === dateFilter;
      const orgMatch = orgFilter ? log.organization === orgFilter : true;
      const noShowMatch = noShowFilter
        ? noShowFilter === "yes"
          ? log.noShow
          : !log.noShow
        : true;
      const actionMatch = actionFilter ? log.action === actionFilter : true;
      const searchMatch = search
        ? [log.clientName, log.eventNumber, log.tablingSpot, log.user, log.notes]
            .join(" ")
            .toLowerCase()
            .includes(search.toLowerCase())
        : true;

      return dateMatch && orgMatch && noShowMatch && actionMatch && searchMatch;
    });

    setFilteredLogs(filtered);
  }, [logs, orgFilter, noShowFilter, actionFilter, search, dateFilter]);

  return (
    <div className="min-h-screen bg-gray-900 text-white p-6">
      <TopBar />
      <h2 className="text-center text-3xl font-bold text-asuGold my-6">Tabling Logs</h2>

      {/* Filters */}
      <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-4 gap-4 mb-6">
        <input
          type="date"
          value={dateFilter}
          onChange={(e) => setDateFilter(e.target.value)}
          className="bg-gray-800 border border-gray-600 px-3 py-2 rounded"
        />
        <select
          value={orgFilter}
          onChange={(e) => setOrgFilter(e.target.value)}
          className="bg-gray-800 border border-gray-600 px-3 py-2 rounded"
        >
          <option value="">All Organizations</option>
          {orgOptions.map((org) => (
            <option key={org} value={org}>{org}</option>
          ))}
        </select>
        <select
          value={actionFilter}
          onChange={(e) => setActionFilter(e.target.value)}
          className="bg-gray-800 border border-gray-600 px-3 py-2 rounded"
        >
          <option value="">All Actions</option>
          <option value="check_in">Check In</option>
          <option value="check_out">Check Out</option>
          <option value="no_show">No Show</option>
        </select>
        <select
          value={noShowFilter}
          onChange={(e) => setNoShowFilter(e.target.value)}
          className="bg-gray-800 border border-gray-600 px-3 py-2 rounded"
        >
          <option value="">All</option>
          <option value="yes">No Show: Yes</option>
          <option value="no">No Show: No</option>
        </select>
        <input
          type="text"
          placeholder="Search client, event, spot..."
          className="bg-gray-800 border border-gray-600 px-3 py-2 rounded col-span-1 md:col-span-2 lg:col-span-1"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
      </div>

      {/* Table */}
      <div className="overflow-x-auto">
        <table className="min-w-full text-sm text-left">
          <thead className="bg-asuMaroon text-white">
            <tr>
              <th className="px-3 py-2">Date</th>
              <th className="px-3 py-2">Action</th>
              <th className="px-3 py-2">Event #</th>
              <th className="px-3 py-2">Organization</th>
              <th className="px-3 py-2">Client</th>
              <th className="px-3 py-2">Spot</th>
              <th className="px-3 py-2">Check-In</th>
              <th className="px-3 py-2">Check-Out</th>
              <th className="px-3 py-2">No Show</th>
              <th className="px-3 py-2">User</th>
              <th className="px-3 py-2">Tables</th>
              <th className="px-3 py-2">Chairs</th>
              <th className="px-3 py-2">Notes</th>
            </tr>
          </thead>
          <tbody>
            {filteredLogs.map((log, idx) => (
              <tr key={idx} className="border-b border-gray-700">
                <td className="px-3 py-2">{moment(log.timestamp || log.checkInTime || log.rangeStart).format("MMM D, YYYY")}</td>
                <td className="px-3 py-2 capitalize">{log.action.replace("_", " ")}</td>
                <td className="px-3 py-2">{log.eventNumber || "-"}</td>
                <td className="px-3 py-2">{log.organization}</td>
                <td className="px-3 py-2">{log.clientName || "-"}</td>
                <td className="px-3 py-2">{log.tablingSpot || "-"}</td>
                <td className="px-3 py-2">
                  {log.checkInTime ? moment(log.checkInTime).format("h:mm A") : "-"}
                </td>
                <td className="px-3 py-2">
                  {log.checkOutTime ? moment(log.checkOutTime).format("h:mm A") : "-"}
                </td>
                <td className="px-3 py-2">
                  {log.noShow ? (
                    <span className="bg-green-600 text-white px-2 py-1 rounded-full text-xs">Yes</span>
                  ) : (
                    <span className="bg-red-600 text-white px-2 py-1 rounded-full text-xs">No</span>
                  )}
                </td>
                <td className="px-3 py-2">{log.user || "-"}</td>
                <td className="px-3 py-2">
                  {log.table?.barcode ? `Yes 1 table (${log.table.barcode})` : "No"}
                </td>
                <td className="px-3 py-2">
                  {log.chairs?.length
                    ? `Yes ${log.chairs.length} chair(s) (${log.chairs.map(c => c.barcode).join(", ")})`
                    : "No"}
                </td>
                <td className="px-3 py-2">{log.notes || "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {filteredLogs.length === 0 && (
          <p className="text-center text-gray-400 mt-10">No tabling logs match the selected filters.</p>
        )}
      </div>
    </div>
  );
}

export default TablingLogs;
